    def test_WYMeshTestCase_get_mesh_v_str_TC_NC_0001(self):
        """
        ----------------------------------------------------------------------
        Title:
        ----------------------------------------------------------------------
        WYMesh get_mesh_v_str function testing normal case 0001

        ----------------------------------------------------------------------
        Description:
        ----------------------------------------------------------------------
        Testing if the mesh object vertices array is properly initialized through "get_mesh_v_str" function, which primitive is created with code "bpy.ops.mesh.primitive_cube_add(location=(0,0,0), rotation=(0,0,0))" generates the default Blender cube on location (0,0,0) with rotation (0,0,0) and the member variable is intialized after function call resulting self.get_mesh_v_str() =="v -1.0 -1.0 -1.0\nv -1.0 -1.0 1.0\nv -1.0 1.0 -1.0\nv -1.0 1.0 1.0\nv 1.0 -1.0 -1.0\nv 1.0 -1.0 1.0\nv 1.0 1.0 -1.0\nv 1.0 1.0 1.0\n" 
        ----------------------------------------------------------------------
        Return:
        ----------------------------------------------------------------------
        :return: Return initialized WYMesh object with member variables intialized properly
        :rtype : string
        ----------------------------------------------------------------------
        Expected result:
        ----------------------------------------------------------------------
        :expect: self.get_mesh_v_str() =="v -1.0 -1.0 -1.0\\nv -1.0 -1.0 1.0\\nv -1.0 1.0 -1.0\\nv -1.0 1.0 1.0\\nv 1.0 -1.0 -1.0\\nv 1.0 -1.0 1.0\\nv 1.0 1.0 -1.0\\nv 1.0 1.0 1.0\\n"
        :expect: "v -1.0 -1.0 -1.0\\nv -1.0 -1.0 1.0\\nv -1.0 1.0 -1.0\\nv -1.0 1.0 1.0\\nv 1.0 -1.0 -1.0\\nv 1.0 -1.0 1.0\\nv 1.0 1.0 -1.0\\nv 1.0 1.0 1.0\\n"
        :expect: (0,0,0)
        """
        bpy.ops.mesh.primitive_cube_add(location=(0,0,0), rotation=(0,0,0))
        cube = bpy.context.object
        cube.name = "TestCube0001"
        wymesh = WYMesh(cube, WYCoordsys(False,False,False,False,True,False,False,False,True,False,False,False))
        wymesh.init_mesh_vertex_data()
        self.assertTrue(wymesh.main_mesh_obj.name == "TestCube0001")
        self.assertTrue(len(wymesh.main_mesh.polygons) == 6)
        self.assertTrue(wymesh.get_mesh_v_str() == "v -1.0 -1.0 -1.0\nv -1.0 -1.0 1.0\nv -1.0 1.0 -1.0\nv -1.0 1.0 1.0\nv 1.0 -1.0 -1.0\nv 1.0 -1.0 1.0\nv 1.0 1.0 -1.0\nv 1.0 1.0 1.0\n")
